import React from 'react';
import { Navbar, Container, Button, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSunBright } from '@fortawesome/free-solid-svg-icons';
import DarkLogo from '../images/DarkLogo.png';
import LightLogo from '../images/LightLogo.png';


export default function NavBarComponent() {
    return (
        <Navbar bg="dark" expand="lg">
            <Container fluid>
                <Navbar.Brand><Link to="/"><img src={DarkLogo} alt="Logo" width="200" /></Link></Navbar.Brand>
                <Navbar.Toggle aria-controls="navbarScroll" />
                <Navbar.Collapse id="navbarScroll">
                    <Nav
                        className="me-auto my-2 my-lg-0"
                    >
                    </Nav>
                    <Link to='/Register'><Button style={{ fontWeight: 'bold', background: 'rgb(87,73,173)', border: 'none' }} className="mx-2" variant="primary">REGISTER</Button></Link>
                    <Link to='/Login'><Button style={{ fontWeight: 'bold', background: 'rgb(0,118,111)' }} className="mx-2" variant="success">LOGIN</Button></Link>
                    <Button style={{ fontWeight: 'bold' }} className="mx-2" variant="outline-secondary"><FontAwesomeIcon icon="fa-solid fa-sun-bright" /></Button>
                </Navbar.Collapse>
            </Container>
        </Navbar >
    )
}
